import React from 'react';
import '../../App.css';
import { Button } from '../Button';

export default function Profile() {
  return(
        
        <div className='input-areas'>
          <form>
            <input
              className='footer-input'
              name='email'
              type='email'
              placeholder='Helloooo'
            />
            <Button buttonStyle='btn--outline'>Subscribe</Button>
          </form>
        </div>
    )
}
